class Solution:
    #def maxProduct(self, nums: List[int]) -> int:
    def maxProduct(self, nums) -> int:
        #Time exceed in leetcode


        if len(nums) == 0:
            return 0
        
        total_negative = 0        
        for v in nums:
            if v < 0:
                total_negative += 1

        maxRes = nums[0]

        for i, v in enumerate(nums):
            curProduct = v
            maxRes = max(maxRes, curProduct)

            if v == 0:
                continue
            
            cur_negative = total_negative

            for j in range(i+1, len(nums)):
                if nums[j] == 0:
                    break
                elif cur_negative == 0 and curProduct < 0:
                    break
                elif cur_negative == 1 and curProduct > 0 and nums[j] < 0:
                    break

                curProduct *= nums[j]
                maxRes = max(maxRes, curProduct)
                if nums[j] < 0:
                    cur_negative -= 1

            if v < 0:
                total_negative -= 1

        return maxRes
        

